import React, { Component } from 'react';

import Auth from './auth';
import Header from './header';
import Body from './body';
import Footer from './footer';


class App extends Component {
	render() {
		return (
			<div className="app">
				<Header />
				<Body />
				<Footer />
			</div>
		);
	}
}

export default App;
